;; **
;;; ## Distributions
;; **

;; @@
(defn plot-dg-dist [coll]
  (let [dat {:values (center-degree coll t0 tmax :distribution)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :values]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 10 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "Degree"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Center Degree distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-autumn/plot-dg-dist</span>","value":"#'radioactive-autumn/plot-dg-dist"}
;; <=

;; @@
(for [b broadcasters]
  (plot-dg-dist b))
